import React, { useRef, useEffect, useState } from 'react';
import { Box, Paper, Typography, IconButton, Tooltip } from '@mui/material';
import ZoomInIcon from '@mui/icons-material/ZoomIn';
import ZoomOutIcon from '@mui/icons-material/ZoomOut';

function LaunchTimeline({ launches }) {
  const canvasRef = useRef(null);
  const containerRef = useRef(null);
  const [scale, setScale] = useState(1);
  const [isDragging, setIsDragging] = useState(false);
  const [startX, setStartX] = useState(0);
  const [scrollLeft, setScrollLeft] = useState(0);
  const [hoveredLaunch, setHoveredLaunch] = useState(null);

  const drawTimeline = (ctx, width, height) => {
    ctx.clearRect(0, 0, width, height);

    if (launches.length === 0) return;

    const sortedLaunches = [...launches].sort((a, b) => 
      new Date(a.date_utc) - new Date(b.date_utc)
    );

    const startDate = new Date(sortedLaunches[0].date_utc);
    const endDate = new Date(sortedLaunches[sortedLaunches.length - 1].date_utc);
    const timeRange = endDate - startDate;

    const baseWidth = width * scale;
    const margin = 50;
    const lineY = height / 2;

    // Draw main timeline line
    ctx.beginPath();
    ctx.strokeStyle = 'rgba(0, 245, 255, 0.3)';
    ctx.lineWidth = 2;
    ctx.moveTo(margin, lineY);
    ctx.lineTo(baseWidth - margin, lineY);
    ctx.stroke();

    // Draw launch points
    sortedLaunches.forEach((launch) => {
      const launchDate = new Date(launch.date_utc);
      const x = margin + ((launchDate - startDate) / timeRange) * (baseWidth - 2 * margin);
      const y = lineY;
      const radius = hoveredLaunch?.id === launch.id ? 8 : 6;

      ctx.beginPath();
      ctx.fillStyle = launch.success ? '#4caf50' : '#f44336';
      ctx.strokeStyle = hoveredLaunch?.id === launch.id ? '#00f5ff' : 'rgba(255, 255, 255, 0.5)';
      ctx.lineWidth = 2;
      ctx.arc(x, y, radius, 0, Math.PI * 2);
      ctx.fill();
      ctx.stroke();

      // Draw year markers
      if (launchDate.getMonth() === 0 && launchDate.getDate() <= 7) {
        ctx.beginPath();
        ctx.strokeStyle = 'rgba(255, 255, 255, 0.2)';
        ctx.moveTo(x, lineY - 15);
        ctx.lineTo(x, lineY + 15);
        ctx.stroke();

        ctx.fillStyle = 'rgba(255, 255, 255, 0.7)';
        ctx.font = '12px Arial';
        ctx.textAlign = 'center';
        ctx.fillText(launchDate.getFullYear(), x, lineY + 30);
      }
    });
  };

  const handleMouseDown = (e) => {
    setIsDragging(true);
    setStartX(e.pageX - containerRef.current.offsetLeft);
    setScrollLeft(containerRef.current.scrollLeft);
  };

  const handleMouseMove = (e) => {
    if (!isDragging) {
      // Handle hover effect
      const rect = canvasRef.current.getBoundingClientRect();
      const x = e.clientX - rect.left;
      const y = e.clientY - rect.top;

      const sortedLaunches = [...launches].sort((a, b) => 
        new Date(a.date_utc) - new Date(b.date_utc)
      );

      const startDate = new Date(sortedLaunches[0].date_utc);
      const endDate = new Date(sortedLaunches[sortedLaunches.length - 1].date_utc);
      const timeRange = endDate - startDate;
      const baseWidth = canvasRef.current.width * scale;
      const margin = 50;
      const lineY = canvasRef.current.height / 2;

      const hovered = sortedLaunches.find(launch => {
        const launchDate = new Date(launch.date_utc);
        const pointX = margin + ((launchDate - startDate) / timeRange) * (baseWidth - 2 * margin);
        const pointY = lineY;
        const distance = Math.sqrt((x - pointX) ** 2 + (y - pointY) ** 2);
        return distance < 10;
      });

      setHoveredLaunch(hovered || null);
      return;
    }

    const x = e.pageX - containerRef.current.offsetLeft;
    const walk = (x - startX) * 2;
    containerRef.current.scrollLeft = scrollLeft - walk;
  };

  const handleMouseUp = () => {
    setIsDragging(false);
  };

  const handleZoom = (direction) => {
    setScale(prevScale => {
      const newScale = direction === 'in' ? prevScale * 1.2 : prevScale / 1.2;
      return Math.min(Math.max(newScale, 0.5), 5);
    });
  };

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    const container = containerRef.current;

    // Set canvas size
    canvas.width = container.clientWidth;
    canvas.height = 200;

    // Enable high DPI rendering
    const dpr = window.devicePixelRatio || 1;
    const rect = canvas.getBoundingClientRect();
    canvas.width = rect.width * dpr;
    canvas.height = rect.height * dpr;
    ctx.scale(dpr, dpr);
    canvas.style.width = `${rect.width}px`;
    canvas.style.height = `${rect.height}px`;

    drawTimeline(ctx, canvas.width / dpr, canvas.height / dpr);

    const handleResize = () => {
      canvas.width = container.clientWidth * dpr;
      canvas.style.width = `${container.clientWidth}px`;
      drawTimeline(ctx, canvas.width / dpr, canvas.height / dpr);
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, [launches, scale, hoveredLaunch]);

  return (
    <Paper 
      sx={{ 
        p: 3,
        background: 'rgba(26, 44, 78, 0.6)',
        backdropFilter: 'blur(10px)',
        position: 'relative'
      }}
    >
      <Typography variant="h6" gutterBottom sx={{ color: '#00f5ff' }}>
        Launch Timeline
      </Typography>

      <Box sx={{ position: 'absolute', right: 16, top: 16, zIndex: 1 }}>
        <Tooltip title="Zoom In">
          <IconButton onClick={() => handleZoom('in')} size="small" sx={{ color: 'white' }}>
            <ZoomInIcon />
          </IconButton>
        </Tooltip>
        <Tooltip title="Zoom Out">
          <IconButton onClick={() => handleZoom('out')} size="small" sx={{ color: 'white' }}>
            <ZoomOutIcon />
          </IconButton>
        </Tooltip>
      </Box>

      <Box
        ref={containerRef}
        sx={{
          overflow: 'hidden',
          cursor: isDragging ? 'grabbing' : 'grab',
          position: 'relative'
        }}
        onMouseDown={handleMouseDown}
        onMouseMove={handleMouseMove}
        onMouseUp={handleMouseUp}
        onMouseLeave={handleMouseUp}
      >
        <canvas
          ref={canvasRef}
          style={{
            display: 'block',
            width: '100%',
            height: '200px'
          }}
        />

        {hoveredLaunch && (
          <Box
            sx={{
              position: 'absolute',
              top: '50%',
              left: '50%',
              transform: 'translate(-50%, -120%)',
              backgroundColor: 'rgba(26, 44, 78, 0.95)',
              borderRadius: 1,
              p: 1,
              boxShadow: 3,
              border: '1px solid rgba(0, 245, 255, 0.3)',
              pointerEvents: 'none'
            }}
          >
            <Typography variant="body2" sx={{ color: '#00f5ff' }}>
              {hoveredLaunch.name}
            </Typography>
            <Typography variant="caption" sx={{ color: 'rgba(255, 255, 255, 0.7)' }}>
              {new Date(hoveredLaunch.date_utc).toLocaleDateString()}
            </Typography>
          </Box>
        )}
      </Box>
    </Paper>
  );
}

export default LaunchTimeline;
